import React from 'react';
import matchData from '../Data/MatchData';

const MatchList = () => {
    const handleMatchDetails = (matchId) => {
      // Maçı incele işlemi burada gerçekleştirilebilir
      console.log(`Maçı İncele: ${matchId}`);
    };

    const handleGeneratePrediction = (matchId) => {
      // Tahmin üret işlemi burada gerçekleştirilebilir
      console.log(`Tahmin Üret: ${matchId}`);
    };

    return (
      <section className="p-4">
        <h2 className="text-xl font-bold mb-4">Maç Listesi</h2>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
          {matchData.map((match) => (
            <div key={match.id} className="border p-4 flex items-center justify-between">
              <div className="flex items-center">
                <img src={match.team1.logo} alt={match.team1.name} className="w-8 h-8 mr-2" />
                <p>{match.team1.name}</p>
              </div>
              <p>{match.date}</p>
              <div className="flex items-center">
                <p>{match.team2.name}</p>
                <img src={match.team2.logo} alt={match.team2.name} className="w-8 h-8 ml-2" />
              </div>
              <div className="flex space-x-4">
                <button
                  onClick={() => handleMatchDetails(match.id)}
                  className="bg-blue-500 text-white px-3 py-1 rounded"
                >
                  Maçı İncele
                </button>
                <button
                  onClick={() => handleGeneratePrediction(match.id)}
                  className="bg-green-500 text-white px-3 py-1 rounded"
                >
                  Tahmin Üret
                </button>
              </div>
            </div>
          ))}
        </div>
      </section>
    );
  };
export default MatchList;
